function mint(uint256 _mintAmount) public payable mintCompliance(_mintAmount) {
    require(publicSale, "The contract is paused!"); 

        if (msg.sender != owner()) {
            require(msg.value >= cost * _mintAmount, "insufficient funds");
        }

    _mintLoop(msg.sender, _mintAmount);
  }

function Minting(bytes32[] calldata signature,uint256 _mintAmount,uint256 quantity) external payable mintCompliance(_mintAmount){

    require(preSale ,"Presale is not active");
        require(msg.value >= cost * _mintAmount, "insufficient funds");
        bytes32 leaf = keccak256(abi.encodePacked(msg.sender,quantity)); 
        require(MerkleProof.verify(signature,MerkleRoot,leaf),"user is not whitelisted");

        if (quantity == 2) {

              require(WL[msg.sender] + _mintAmount <= quantity , "You reached your max minting");
              WL[msg.sender]=WL[msg.sender]+_mintAmount;
              Gift(msg.value);
              return _mintLoop(msg.sender, _mintAmount);


        } else if (quantity == 6) {

              require(VIP[msg.sender] + _mintAmount <= quantity , "You reached your max minting");
              VIP[msg.sender]=VIP[msg.sender]+_mintAmount;
              Gift(msg.value);
              return _mintLoop(msg.sender, _mintAmount);

        } else {

              uint256 ArrayMinted = Deathlist[msg.sender];
              require( ArrayMinted + _mintAmount <= quantity , "You reached your max minting");
              if(ArrayMinted == 0){
                 _mintLoop(msg.sender, _mintAmount + 2);
              } else {
                 _mintLoop(msg.sender, _mintAmount);
              }
              Deathlist[msg.sender]=ArrayMinted+_mintAmount;
              return Gift(msg.value);
        }

  }

function Claim(bytes32[] calldata signature,uint256 _mintAmount,uint256 quantity) external payable mintCompliance(_mintAmount){

    require(claiming ,"claming is not active");

          bytes32 leaf = keccak256(abi.encodePacked(msg.sender,quantity)); 
          require(MerkleProof.verify(signature,claimMerkleRoot,leaf),"user is not whitelisted");
          require(msg.value >= cost * _mintAmount, "insufficient funds");
          require(quantity == 1, "You can't claim");
          require(claimed[msg.sender] == false, "already claimed");
          claimed[msg.sender] = true;
          _mintLoop(msg.sender, 2);

  }

